            "width": 38
        },
        {
            "dataField": "name",
            "caption": "Name",
            "calculateCellValue": "function(data) {return data.Name.slice(0,-5);}"
        },
        {
            "dataField": "path",
            "caption": "Language",
            "calculateCellValue": "function(data) {if(data.Path.includes('/en/')){return 'en';} if(data.Path.includes('/pt-br/')){return 'pt-br';}if(data.Path.includes('/es/')){return 'es';}}",
            "alignment": "center"
        },
        {
            "caption": "",
            "width": 38,
            "alignment": "center",
            "cellTemplate": "function(e, i){    if(i.data.ModifiedBy.ImageUrl != null){        SkillsWorkflow.Utils.setExternalImage(e, 'small', i.data.ModifiedBy.ImageUrl);} else {SkillsWorkflow.Utils.setExternalImage(e, 'small', 'https:/'+'/cdn.pixabay.com/photo/2013/07/13/12/07/avatar-159236_960_720.png');}}"
        },
        {
            "dataField": "ModifiedBy",
            "caption": "Modified By",
            "alignment": "left",
            "calculateCellValue": "function(data) {return data.ModifiedBy.Name;}"
        },
        {
            "dataField": "ModifiedOn",
            "caption": "Modified On",
            "dataType": "date",
            "alignment": "center"
        },
        {
            "dataField": "ModifiedOn",
            "caption": "Days Ago",
            "dataType": "int",
            "calculateCellValue": "function(data) {var date = data.Commits[0].commit.author.date;var result = SkillsWorkflow.Utils.timeAgo(date, 'days');return result;}",
            "cellTemplate": "function(e, i) { SkillsWorkflow.setRAG(e, i.value, i.value >= 365, i.value > 30 && i.value<365, i.value <= 30, true);}",
            "alignment": "center"
        },
        {
            "dataField": "path",
            "caption": "Location",
            "calculateCellValue": "function(data){if(data.Path.includes('Menu/')){ return 'Menu'; }; if(data.Path.includes('Configuration/')){ return 'Configuration';}; if(data.Path.includes('Document/')){ return 'Document';}}",
            "groupCellTemplate": "function(e, i) { h=document.createElement('span'); var ht=' ' + i.text + ' ('+i.data.aggregates[0]+')'; h.innerHTML = ht;e.append(h);}",
            "groupIndex": 0
        }
    ],
    "summary": {
        "groupItems": [
            {
                "column": "Location",
